return ['x-generator'=>'GlotPress/4.0.0','translation-revision-date'=>'2023-04-03 09:17:49+0000','plural-forms'=>'nplurals=3; plural=(n == 1) ? 0 : ((n >= 2 && n <= 4) ? 1 : 2);','project-id-version'=>'Themes - Twenty Twenty-Two','language'=>'cs_CZ','messages'=>['Built on a solidly designed foundation, Twenty Twenty-Two embraces the idea that everyone deserves a truly unique website. The theme’s subtle styles are inspired by the diversity and versatility of birds: its typography is lightweight yet strong, its color palette is drawn from nature, and its layout elements sit gently on the page. The true richness of Twenty Twenty-Two lies in its opportunity for customization. The theme is built to take advantage of the Site Editor features introduced in WordPress 5.9, which means that colors, typography, and the layout of every single page on your site can be customized to suit your vision. It also includes dozens of block patterns, opening the door to a wide range of professionally designed layouts in just a few clicks. Whether you’re building a single-page website, a blog, a business website, or a portfolio, Twenty Twenty-Two will help you create a site that is uniquely yours.'=>'Twenty Twenty-Two je postaveno na důkladně navržených základech a vychází z myšlenky, že každý si zaslouží skutečně jedinečné webové stránky. Jemné styly tématu jsou inspirovány rozmanitostí a všestranností ptáků: jeho typografie je jednoduchá, ale výrazná, barevná paleta vychází z přírody a prvky rozvržení sedí na stránce jemně. Skutečný přínos Twenty Twenty-Two spočívá v možnosti přizpůsobení. Šablona je vytvořena tak, aby využívala funkce Úplné úpravy webu představené ve WordPressu 5.9, což znamená, že barvy, typografii a rozvržení každé jednotlivé stránky vašeho webu lze přizpůsobit podle vašich představ. Obsahuje také desítky blokových vzorů, což otevírá dveře k široké škále profesionálně navržených rozvržení na několik kliknutí. Ať už vytváříte jednostránkový web, blog, firemní web nebo